REGRAS
1 - Fique na frente do quartel;

2 - Não vá para a Esplanada;

3 - Confie nas Forças Armadas e no Presidente Bolsonaro;

4 - Esqueça políticos, eles não servem para nada e nunca ajudam em nada a anos;

5 - Infiltrados sempre discordam de algum dos tópicos acima;

6 - Nunca escute infiltrados;

7 - Infiltrados sempre agem juntos e criam um falso debate;

8 - Infiltrados sempre querem debater um plano B para tirar o nosso foco;

9 - INFILTRADOS SEMPRE DIZEM QUE NÃO VAI DAR EM NADA E SÃO PESSIMISTAS (mesmo vendo tanques na rua, eles fingem que nada está acontecendo);

10 - Há grupos de petistas que se fingem de patriotas. Os admins petistas nunca banem os infiltrados.

